Add this following full line as the URL for a new bookmark and call it anything, "Popout Player" for example. 
javascript:document.getElementsByTagName('video')[0].requestPictureInPicture();
This will give you the pop out player upon clicking the bookmark and will always stay on top of whatever you're doing. Works amazing when you're on your laptop and need to work but also want to watch LTT.
